import React from "react";
import { makeStyles } from "@material-ui/core/styles";
import Table from "@material-ui/core/Table";
import TableBody from "@material-ui/core/TableBody";
import TableCell from "@material-ui/core/TableCell";
import TableContainer from "@material-ui/core/TableContainer";
import TableHead from "@material-ui/core/TableHead";
import TableRow from "@material-ui/core/TableRow";
import Paper from "@material-ui/core/Paper";
import Avatar from "@material-ui/core/Avatar";
import GroupIcon from "@material-ui/icons/Group";
import { Link } from "react-router-dom";
import Typography from "@material-ui/core/Typography";
import CircularProgress from "@material-ui/core/CircularProgress";
import { Navbar, Nav, NavDropdown, Form, FormControl, Button } from 'react-bootstrap'

const useStyles = makeStyles(theme => ({
  table: {
    minWidth: 600
  },
  avatar: {
    margin: theme.spacing(1),
    backgroundColor: theme.palette.secondary.main
  },
  paper: {
    display: "flex",
    flexDirection: "column",
    justifyContent: "center",
    alignItems: "center",
    margin: `10px`,
    height: "100%",
    width: "99%",
    marginTop: theme.spacing(7)
  },
  link: {
    color: "rgba(0,0,0,0.65)",
    textDecoration: "none",
    marginLeft: "10%",
    alignSelf: "flex-start",
    "&:hover": {
      color: "rgba(0,0,0,1)"
    }
  }
}));

export default function CharitiesList() {
  const classes = useStyles();

  const [recipients, upDateRecipients] = React.useState([]);
  const [details, upDateDetails] = React.useState([]);
  const [name, upDateName] = React.useState([]);
  const [firstLoad, setLoad] = React.useState(true);
  let isLoading = true;

  async function sampleFunc() {
    let response = await fetch("/api/details/");
    let details = await response.json();
    let response2 = await fetch('/api/name/');
    let name = await response2.json();
    let response3 = await fetch('/api/recipients/');
    let recipients = await response3.json();
    upDateDetails(details);
    upDateName(name);
    upDateRecipients(recipients);
  }

  if (firstLoad) {
    sampleFunc();
    setLoad(false);
  }

  if (details.length > 0) isLoading = false;

  return (
    <div className={classes.paper}>
      <Avatar className={classes.avatar}>
        <GroupIcon />
      </Avatar>
      <Typography component="h1" variant="h5">
        Charities using Acons Charity Management
      </Typography>

      {isLoading ? (
        <CircularProgress />
      ) : (
        <TableContainer
          style={{ width: "80%", margin: "0 10px" }}
          component={Paper}
        >
          <Table className={classes.table} aria-label="simple table">
            <TableHead>
              <TableRow>
                <TableCell align="left">Name</TableCell>
                <TableCell align="center">Charity Summary</TableCell>
                <TableCell align="center">Photo</TableCell>
                <TableCell align="center">Video</TableCell>
                <TableCell align="right">Website</TableCell>
              </TableRow>
            </TableHead>
            <TableBody>
              {recipients?.map(recipients => <div key={recipients.pk_recipient_id}>
              {details?.map(details => <div key={details.pk_details_id}>
                {name?.map(name => <div key={name.pk_name_id}>
                  {details.fk_user_id === recipients.fk_user_id && name.fk_user_id === recipients.fk_user_id ?
                <TableRow key={name.orgname}>
                  <TableCell align="left">{name.orgname}</TableCell>
                  <TableCell align="center">{details.user_statement}</TableCell>
                  <TableCell align="center">{details.user_photo}</TableCell>
                  <TableCell align="center">{details.user_video}</TableCell>
                  <TableCell align="right" ><Nav.Link href={details.user_url} align="right">Website</Nav.Link></TableCell>
                </TableRow>
                : null}
              </div>
              )} </div>
              )} </div>
              )}
            </TableBody>
          </Table>
        </TableContainer>
      )}
    </div>
  );
}
